import React from 'react';
import { Navbar,Container, Button } from 'react-bootstrap';
import { useHistory } from 'react-router';
import './Navbarapp.css'

const Navbarapp = () => {
    
    let history =useHistory()
    
    return (
    <Navbar className="fondo">
        <Container>
          
        </Container>

        <Navbar.Brand href="#home">
        <div className="logo">
        <img
              alt=""
              src="https://lostramites.com.co/wp-content/uploads/logo-de-SENA-png-Negro-300x300.png"
              width="80"
              height="80"
              className="d-inline-block"
              />{' '}
              SENA
        </div>
        </Navbar.Brand>

        <div className="botones">
              <Button variant="light" onClick={() =>history.push('/Newhome')}>HOJA DE VIDA</Button>{' '}
              <Button variant="light">CUSROS</Button>{' '}
              <Button variant="light">PQRS</Button>{' '}
              </div>
      </Navbar>
    )
}

export default Navbarapp
